export const Slide = () => {
  return (
    <div className="p-4 p-md-5 mb-4 rounded navbar-text-color navbar-color text-center">
      <div>
        <h1 className="display-4 fst-italic">
          <strong>Welcome to Coffees Shop</strong>
        </h1>
        <p className="lead my-3">Have a cup of coffee & enjoy your shoppings</p>
      </div>
    </div>
  );
};
